import React from "react";

import { Form } from "react-bootstrap";
import "./FilterEvents.css";
const FilterEvents = (props) => {
  return (
    <div className="filterSportsRadio">
      <Form>
        {["radio"].map((type) => (
          <div >
            <Form.Check
              inline
              label="1"
              name="group1"
              
            />
            <Form.Check
              inline
              label="2"
              name="group1"
              type={type}
              id={`inline-${type}-2`}
            />
            <Form.Check
              inline
              disabled
              label="3"
              type={type}
              id={`inline-${type}-3`}
            />
          </div>
        ))}
      </Form>
    </div>
  );
};

<Form>
<FormCheck type="radio"/>
<FormCheck type="radio"/>

<FormCheck type="radio"/>

</Form>
export default FilterEvents;
